import React from 'react'
import {Grid, Card, CardMedia, Typ} from '@material-ui/core'

import { makeStyles } from '@material-ui/styles'


const useStyles = makeStyles(theme => ({
  root: {
    position: "relative",

    '& .MuiCardMedia-root': {
      backgroundImage: "url(https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg)",
    },
    '&:hover': {
      '& .MuiCardMedia-root': {
      backgroundImage: "none",
    },
      cursor: 'pointer',

      '& $cardHover': {
      display: "block",
      position: "absolute",
      top: '30%',
      left: '40%'
    },
    }

  },
  cardHover: {
    display: "none"
  },
}))


function ProjectCard() {
  const classes = useStyles()
  return (
    <Grid item xs={12} sm={4}>
      <Card style={{margin: "20px 10px"}} className={classes.root}>
        <CardMedia
        style={{height: "280px"}}
        src = "https://lp-cms-production.imgix.net/news/2019/02/taj-mahal-monkey.jpg"
        />
        <div className={classes.cardHover}>

        </div>

      </Card>
    </Grid>
  )
}

export default ProjectCard
